import React from "react";
import Slider from "react-slick";
import Content from '../Content'
import Ty from "../../Ty"

export default function SimpleSlider() {
  var settings = {
    dots: false,
    infinite: true,
    speed: 100,
    slidesToShow: 1,
    slidesToScroll: 1
  };
  return (
    <Slider {...settings}>
      {Ty.map((props) => (
        <Content
          image={props.image}
       />
       ))}
    </Slider>
  );
}
